import React, { Component } from 'react';

import Header from '../components/Header'
import Footer from '../components/Footer'

class About extends Component {
  state = {  }
  render() {
    return (
      <div>
        <Header />
        <section id="gallery">
          <div class="container">
            <div class="row">
              <div class="col-lg-4 mb-4">
                <div class="card">
                  <img class="card-img-top" src="https://www.cesarsway.com/sites/newcesarsway/files/styles/large_article_preview/public/Natural-Dog-Law-2-To-dogs%2C-energy-is-everything.jpg?itok=Z-ujUOUr" alt="" />
                  <div class="card-body">
                    <h5 class="card-title">First Thing</h5>
                    <p class="card-text">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Assumenda corrupti quam magnam!
                        Veniam, dolorum facere?
                        Commodi, ut. Et, itaque quam!</p>
                    <a href="" class="btn btn-outline-success btn-sm">Download</a>
                    <a href="" class="btn btn-outline-danger btn-sm"><i class="far fa-heart"></i></a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
        <Footer />
        <style jsx>{`
          .bg {
            // background: white;
          }

          .content {
            height: 90vh;
          }
        `}</style>
      </div>
    );
  }
}

export default About;
